import React, { Component } from "react";
class Search extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <p>
          <i>
            {" "}
            <input
              type="text"
              className="input"
              placeholder="Class"
              id="classInput"
            />
          </i>
          <i>
            <input
              type="text"
              className="input"
              placeholder="Search..."
              id="searchInput"
            />{" "}
          </i>
        </p>
      </React.Fragment>
    );
  }
}

export default Search;

function cname() {
  var cinput = document.getElementById("classInput").value;
  alert(cinput);
}

function sname() {
  var sinput = document.getElementById("searchInput").value;
  alert(sinput);
}
